import React from "react";
import { LogModalWrap } from "../../styles/components/LogModalStyle";

export default function LogoutModal() {
  return (
    <LogModalWrap>
      <div className="container">
        <div  className="container">Do you want to logout?</div>
        <div>
          <button>Yes</button>
          <button>No</button>
        </div>
      </div>
    </LogModalWrap>
  );
}
